import React from 'react'

function RenderingLists() {
    const bookList = [
        'to kill a mocking bird',
        'the great gatsby',
        'the catcher in the rye',
    ]

    const books = [
        {
            title: 'to kill a mocking bird',
            author: 'harper lee',


        }
    ]
  return (
    <div>
        {bookList.map(book => {
            return <h2>{book}</h2>
        })}
    </div>
  )
}

export default RenderingLists
